import "./ThetaboardNFT.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title nft_sell
 * sell NFT for thetaboard.io
 */
contract ThetaboardSellNft is Ownable {

    ThetaboardNFT public nftAddress;
    uint256 public currentPrice;

    /**
    * @dev Contract Constructor
    * @param _nftAddress address for ERC-721
    * @param _currentPrice initial sales price
    */
    constructor(address _nftAddress, uint256 _currentPrice) public {
        require(_nftAddress != address(0) && _nftAddress != address(this));
        require(_currentPrice > 0);
        nftAddress = ThetaboardNFT(_nftAddress);
        currentPrice = _currentPrice;
    }

    /**
    * @dev Purchase _tokenId
    * receive so
    */
    receive() external payable {
        require(msg.sender != address(0) && msg.sender != address(this));
        require(msg.value >= currentPrice);
        nftAddress.mint(msg.sender);
        payable(owner()).transfer(msg.value);
    }

    /**
    * @dev Updates _currentPrice
    * @dev Throws if _currentPrice is zero
    */
    function setCurrentPrice(uint256 _currentPrice) public onlyOwner {
        require(_currentPrice > 0);
        currentPrice = _currentPrice;
    }

}

